INSERT INTO tip (id,tip) VALUES (16,Marinate the chicken for at least 30 minutes for best flavor.);
INSERT INTO tip (id,tip) VALUES (17,Adjust the amount of dried chilies to suit your spice tolerance.);
INSERT INTO tip (id,tip) VALUES (18,Serve with steamed rice to balance the bold flavors.);
