INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (1,Hollow out a medium-sized pumpkin, removing seeds and fibers.,Ghapama,Armenian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (2,In a bowl, mix cooked rice with chopped dried fruits (apricots, prunes, raisins), nuts (almonds, walnuts), and honey.,Ghapama,Armenian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (3,Fill the pumpkin with the rice mixture and place a lid cut from the top.,Ghapama,Armenian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (4,Bake in a preheated oven at 375°F (190°C) until the pumpkin is tender and the filling is heated through.,Ghapama,Armenian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (5,Serve hot, cutting the pumpkin into wedges to expose the sweet, fragrant stuffing.,Ghapama,Armenian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (1,Cook chicken in water with salt until tender and the meat falls off the bones.,Harissa,Armenian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (2,Remove the chicken, debone, and shred the meat.,Harissa,Armenian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (3,Add washed khorasan wheat to the chicken broth and cook until the wheat is soft and begins to break down.,Harissa,Armenian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (4,Add the shredded chicken back to the pot, continue to cook, stirring frequently, until the mixture becomes porridge-like.,Harissa,Armenian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (5,Serve hot, topped with melted butter and a sprinkle of cinnamon.,Harissa,Armenian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (1,Prepare the dough from flour, yeast, warm water, and salt, and let it rise until doubled in size.,Lahmajoun,Armenian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (2,Mix finely ground lamb or beef with finely diced tomatoes, bell peppers, onion, parsley, and spices.,Lahmajoun,Armenian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (3,Roll the dough into very thin circles, spread the meat mixture thinly on top.,Lahmajoun,Armenian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (4,Bake in a very hot oven for about 5 minutes until the edges are crisp and the topping is cooked.,Lahmajoun,Armenian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (5,Serve hot with a squeeze of lemon and fresh parsley.,Lahmajoun,Armenian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (1,Blanch broccoli florets in boiling water for 2 minutes, then drain.,Beef and Broccoli,Chinese);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (2,Marinate beef slices in a mixture of soy sauce, cornstarch, and a little oil.,Beef and Broccoli,Chinese);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (3,Heat oil in a wok, add minced garlic, and stir-fry briefly until fragrant.,Beef and Broccoli,Chinese);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (4,Add the marinated beef and stir-fry until it starts to brown.,Beef and Broccoli,Chinese);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (5,Add broccoli and stir-fry for another 2 minutes.,Beef and Broccoli,Chinese);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (6,Pour in a mixture of beef stock, oyster sauce, and a splash of soy sauce, and cook until the sauce thickens.,Beef and Broccoli,Chinese);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (7,Serve hot.,Beef and Broccoli,Chinese);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (1,Bring chicken broth to a simmer in a pot.,Egg Drop Soup,Chinese);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (2,Season the broth with soy sauce, salt, and white pepper.,Egg Drop Soup,Chinese);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (3,Slowly pour beaten eggs into the simmering broth, stirring gently to form ribbons.,Egg Drop Soup,Chinese);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (4,Garnish with chopped green onions and a few drops of sesame oil.,Egg Drop Soup,Chinese);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (5,Serve hot.,Egg Drop Soup,Chinese);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (1,Marinate chicken pieces in soy sauce and cornstarch.,Kung Pao Chicken,Chinese);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (2,Heat oil in a wok and fry dried chilies until just beginning to blacken.,Kung Pao Chicken,Chinese);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (3,Add chicken to the wok and stir-fry until it turns white.,Kung Pao Chicken,Chinese);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (4,Add chopped bell peppers and scallions, stir-fry for a few minutes.,Kung Pao Chicken,Chinese);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (5,Pour in the sauce mixture of soy sauce, vinegar, sugar, and water, and cook until thickened.,Kung Pao Chicken,Chinese);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (6,Stir in roasted peanuts and serve.,Kung Pao Chicken,Chinese);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (1,Marinate chicken pieces in lemon juice and salt.,Doro Wat,Ethiopian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (2,Cook onions in a dry pot until golden, then add berbere spice and oil, cooking into a paste.,Doro Wat,Ethiopian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (3,Add garlic and ginger, then the marinated chicken, stirring to coat with the spice mixture.,Doro Wat,Ethiopian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (4,Add enough water to cover, bring to a boil, then simmer until the chicken is tender.,Doro Wat,Ethiopian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (5,Add hard-boiled eggs to the stew in the last 10 minutes.,Doro Wat,Ethiopian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (6,Serve hot with injera.,Doro Wat,Ethiopian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (1,Mix teff flour with water in a bowl until smooth, then cover and let ferment for 1-3 days.,Injera,Ethiopian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (2,After fermentation, stir the batter well and add salt.,Injera,Ethiopian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (3,Heat a non-stick pan or griddle over medium heat.,Injera,Ethiopian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (4,Pour a ladleful of batter into the pan and quickly swirl to spread in a thin layer.,Injera,Ethiopian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (5,Cover and cook for a few minutes until holes form on the surface and edges lift from the pan.,Injera,Ethiopian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (6,Remove injera and let cool on a clean cloth. Repeat with remaining batter.,Injera,Ethiopian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (1,Finely chop or grind fresh, lean beef.,Kitfo,Ethiopian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (2,Melt niter kibbeh in a pan and mix with mitmita.,Kitfo,Ethiopian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (3,Combine the spiced butter with the raw beef, mixing thoroughly.,Kitfo,Ethiopian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (4,Serve immediately with injera and optional ayib (fresh cottage cheese).,Kitfo,Ethiopian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (1,Brown the chicken pieces in a large dutch oven.,Coq au Vin,French);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (2,Remove chicken and sauté onions, mushrooms, and bacon in the same pot.,Coq au Vin,French);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (3,Deglaze the pot with red wine and return the chicken to the pot.,Coq au Vin,French);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (4,Add garlic, thyme, and bay leaf. Simmer until the chicken is tender.,Coq au Vin,French);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (5,Thicken the sauce with a butter-flour mixture before serving.,Coq au Vin,French);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (1,Heat cream with vanilla bean until just hot.,Crème Brûlée,French);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (2,Whisk yolks with sugar until pale, then slowly add the hot cream.,Crème Brûlée,French);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (3,Strain the mixture into ramekins.,Crème Brûlée,French);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (4,Bake in a water bath until set but still trembling in the center.,Crème Brûlée,French);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (5,Cool, then sprinkle sugar on top and torch until caramelized.,Crème Brûlée,French);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (1,Caramelize the sliced onions in a large pot.,French Onion Soup,French);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (2,Add beef broth and bring to a simmer.,French Onion Soup,French);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (3,Season with thyme and bay leaves.,French Onion Soup,French);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (4,Toast baguette slices topped with grated cheese under a broiler until melted and golden.,French Onion Soup,French);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (5,Serve the soup hot with the toasted baguette.,French Onion Soup,French);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (1,Bake chocolate sponge cakes and let them cool.,Black Forest Cake,German);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (2,Cut the cakes into layers and sprinkle each with cherry schnapps.,Black Forest Cake,German);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (3,Whip cream with sugar and vanilla until stiff peaks form.,Black Forest Cake,German);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (4,Assemble the cake by alternating layers of cake with whipped cream and cherries.,Black Forest Cake,German);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (5,Decorate the top with whipped cream, chocolate shavings, and whole cherries.,Black Forest Cake,German);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (6,Chill before serving.,Black Forest Cake,German);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (1,Prepare the dough from flour, yeast, water, salt, and a bit of sugar.,Pretzels,German);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (2,Let the dough rise until doubled.,Pretzels,German);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (3,Divide the dough and roll each piece into a long rope, then twist into the traditional pretzel shape.,Pretzels,German);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (4,Dip each pretzel in a baking soda bath before baking to develop a golden and shiny crust.,Pretzels,German);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (5,Bake until golden brown and sprinkle with coarse salt while still warm.,Pretzels,German);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (1,Marinate the beef roast in a mixture of red wine, vinegar, onions, carrots, and spices for 2-3 days.,Sauerbraten,German);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (2,Remove the beef from the marinade, pat dry, and brown in hot oil in a heavy pot.,Sauerbraten,German);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (3,Strain the marinade and add it to the pot with the beef.,Sauerbraten,German);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (4,Add crushed ginger snaps to thicken and sweeten the sauce.,Sauerbraten,German);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (5,Simmer the roast slowly until it is tender.,Sauerbraten,German);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (6,Slice and serve the roast with the sauce poured over it.,Sauerbraten,German);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (1,Preheat oven and grease the baking dish.,Baklava,Greek);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (2,Layer the filo dough with melted butter and chopped nuts.,Baklava,Greek);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (3,Cut into diamond shapes before baking.,Baklava,Greek);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (4,Bake until golden and crisp.,Baklava,Greek);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (5,Pour cooled syrup over the hot baklava immediately after baking.,Baklava,Greek);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (1,Chop the cucumbers, tomatoes, and red onion.,Greek Salad (Horiatiki),Greek);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (2,Combine vegetables in a large bowl.,Greek Salad (Horiatiki),Greek);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (3,Top with Kalamata olives and crumbled feta cheese.,Greek Salad (Horiatiki),Greek);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (4,Drizzle with olive oil and sprinkle oregano.,Greek Salad (Horiatiki),Greek);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (1,Slice and salt eggplants, then fry until golden.,Moussaka,Greek);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (2,Cook ground meat with onions, garlic, and tomatoes.,Moussaka,Greek);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (3,Layer eggplant and meat mixture in a baking dish.,Moussaka,Greek);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (4,Prepare béchamel sauce and spread over the top.,Moussaka,Greek);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (5,Bake until the surface is golden and bubbly.,Moussaka,Greek);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (1,Marinate chicken in yogurt, garlic, ginger, and spices for at least 2 hours.,Chicken Biryani,Indian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (2,Cook rice until it's 70% done, then drain.,Chicken Biryani,Indian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (3,Fry onions until golden, then set aside.,Chicken Biryani,Indian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (4,Layer the marinated chicken and partially cooked rice in a pot.,Chicken Biryani,Indian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (5,Add saffron infused in warm milk for color.,Chicken Biryani,Indian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (6,Cover and cook on low heat until the rice is fully cooked and the chicken is tender.,Chicken Biryani,Indian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (7,Garnish with fried onions, nuts, and fresh cilantro.,Chicken Biryani,Indian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (1,Peel and chop fresh mangoes.,Mango Lassi,Indian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (2,Blend mangoes with yogurt, milk, sugar, and cardamom until smooth.,Mango Lassi,Indian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (3,Chill in the refrigerator for at least one hour.,Mango Lassi,Indian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (4,Serve cold garnished with a sprinkle of cardamom powder or mint leaves.,Mango Lassi,Indian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (1,Blanch spinach in hot water, then cool and blend into a fine paste.,Palak Paneer,Indian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (2,Fry paneer cubes until golden, set aside.,Palak Paneer,Indian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (3,In the same pan, sauté onions, tomatoes, garlic, and ginger until soft.,Palak Paneer,Indian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (4,Add the spinach paste, spices, and a little water to the pan.,Palak Paneer,Indian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (5,Simmer for 10 minutes, then add fried paneer.,Palak Paneer,Indian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (6,Cook for another 5 minutes, then serve hot with naan or rice.,Palak Paneer,Indian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (1,Season veal shanks with salt and pepper and dredge in flour.,Osso Buco,Italian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (2,Brown the veal shanks in a heavy pot with some olive oil.,Osso Buco,Italian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (3,Remove shanks and sauté onions, carrots, and celery until softened.,Osso Buco,Italian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (4,Deglaze the pot with white wine, then return the shanks to the pot.,Osso Buco,Italian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (5,Add broth until the shanks are nearly covered, bring to a boil, then reduce to a simmer.,Osso Buco,Italian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (6,Cover and cook slowly until the meat is tender, about 2 hours.,Osso Buco,Italian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (7,Serve with gremolata on top.,Osso Buco,Italian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (1,Cook spaghetti in salted boiling water until al dente.,Spaghetti Carbonara,Italian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (2,Render pancetta in a pan until crispy.,Spaghetti Carbonara,Italian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (3,Whisk eggs and Parmesan cheese together in a bowl.,Spaghetti Carbonara,Italian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (4,Drain pasta and mix into the pan with pancetta, off the heat.,Spaghetti Carbonara,Italian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (5,Quickly add egg and cheese mixture, stirring vigorously to create a creamy sauce.,Spaghetti Carbonara,Italian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (6,Season with freshly cracked black pepper and serve immediately.,Spaghetti Carbonara,Italian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (1,Mix egg yolks and sugar until pale and fluffy.,Tiramisu,Italian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (2,Fold in mascarpone cheese gently.,Tiramisu,Italian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (3,Dip ladyfingers in coffee mixed with a splash of coffee liqueur.,Tiramisu,Italian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (4,Layer the ladyfingers in a dish, spread over a layer of mascarpone mixture.,Tiramisu,Italian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (5,Repeat layering and refrigerate for at least 4 hours.,Tiramisu,Italian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (6,Dust with cocoa powder before serving.,Tiramisu,Italian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (1,Whisk together milk, cream, sugar, and matcha powder until the sugar dissolves.,Matcha Ice Cream,Japanese);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (2,Chill the mixture in the refrigerator for at least 2 hours.,Matcha Ice Cream,Japanese);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (3,Process in an ice cream maker according to the manufacturer's instructions.,Matcha Ice Cream,Japanese);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (4,Freeze the churned ice cream until firm, about 2-3 hours.,Matcha Ice Cream,Japanese);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (1,Prepare the broth by simmering chicken or pork bones with onions, garlic, and ginger.,Ramen,Japanese);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (2,Strain the broth and season with soy sauce, miso, or salt.,Ramen,Japanese);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (3,Cook ramen noodles separately until just tender.,Ramen,Japanese);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (4,In bowls, arrange cooked noodles, then pour hot broth over them.,Ramen,Japanese);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (5,Top with slices of pork belly, soft-boiled eggs, green onions, and bamboo shoots.,Ramen,Japanese);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (1,Cook sushi rice and season with sushi vinegar.,Sushi Rolls (Maki Sushi),Japanese);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (2,Spread the cooled rice on a sheet of nori laid out on a bamboo mat.,Sushi Rolls (Maki Sushi),Japanese);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (3,Place fillings like cucumber, avocado, and fish along the center of the rice.,Sushi Rolls (Maki Sushi),Japanese);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (4,Roll the nori tightly using the bamboo mat, pressing firmly.,Sushi Rolls (Maki Sushi),Japanese);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (5,Slice the roll into 6-8 pieces with a sharp knife.,Sushi Rolls (Maki Sushi),Japanese);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (1,Boil large cuts of meat until tender, then remove the meat and reserve the broth.,Beshbarmak,Kazakh);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (2,Hand-make pasta dough, roll it out thinly, and cut into squares.,Beshbarmak,Kazakh);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (3,Cook the pasta squares in the remaining broth until tender.,Beshbarmak,Kazakh);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (4,Slice the boiled meat into bite-sized pieces.,Beshbarmak,Kazakh);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (5,Layer the cooked pasta on a large serving platter, top with meat pieces, then ladle hot broth over the top.,Beshbarmak,Kazakh);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (6,Garnish with chopped parsley and serve.,Beshbarmak,Kazakh);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (1,Prepare the intestines by thoroughly cleaning and then soaking in cold water.,Kazy,Kazakh);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (2,Cut the horse meat and fat into strips, season with salt, pepper, and minced garlic.,Kazy,Kazakh);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (3,Stuff the seasoned meat and fat tightly into the intestines.,Kazy,Kazakh);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (4,Tie off the ends of the sausage and boil in water for an hour, or smoke for several hours until cooked through.,Kazy,Kazakh);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (5,Serve sliced with traditional sides of bread and onions.,Kazy,Kazakh);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (1,Drain the whey from sour milk or yogurt completely.,Kurt,Kazakh);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (2,Mix the curd with salt and press any remaining liquid out.,Kurt,Kazakh);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (3,Form the curd into small balls and cover them in cloth.,Kurt,Kazakh);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (4,Leave the balls to dry in a cool, ventilated area until hard.,Kurt,Kazakh);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (5,Store in a dry place until ready to consume.,Kurt,Kazakh);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (1,Marinate the meat in a mixture of lemon juice, garlic, ginger, and salt for at least 1 hour.,Nyama Choma,Kenyan);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (2,Prepare a charcoal grill or preheat a gas grill.,Nyama Choma,Kenyan);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (3,Grill the meat over medium heat, turning regularly, until well browned and cooked to desired doneness.,Nyama Choma,Kenyan);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (4,Rest the meat for 10 minutes before slicing.,Nyama Choma,Kenyan);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (5,Serve with kachumbari (a fresh tomato and onion salad) and Ugali.,Nyama Choma,Kenyan);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (1,Heat oil in a pan over medium heat. Add onions and sauté until translucent.,Sukuma Wiki,Kenyan);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (2,Add minced garlic and continue to sauté for about 1 minute.,Sukuma Wiki,Kenyan);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (3,Add the chopped collard greens, stirring to combine with the onions and garlic.,Sukuma Wiki,Kenyan);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (4,Season with salt, pepper, and a pinch of cayenne for heat.,Sukuma Wiki,Kenyan);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (5,Cover and simmer over low heat until the greens are tender, adding a little water if necessary.,Sukuma Wiki,Kenyan);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (6,Serve hot with Ugali or as a side dish to any meal.,Sukuma Wiki,Kenyan);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (1,Bring water to a boil in a large pot.,Ugali,Kenyan);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (2,Slowly pour the cornmeal into the boiling water, stirring continuously with a wooden spoon.,Ugali,Kenyan);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (3,Continue to cook and stir until the mixture thickens and pulls away from the sides of the pot.,Ugali,Kenyan);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (4,Turn out the Ugali onto a plate and mold into a round shape.,Ugali,Kenyan);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (5,Serve hot with a stew or vegetables.,Ugali,Kenyan);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (1,Cook the rice according to package instructions.,Bibimbap,Korean);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (2,Prepare and sauté each vegetable separately in a pan with a small amount of oil.,Bibimbap,Korean);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (3,Marinate beef slices in soy sauce, garlic, and sesame oil, then fry until cooked.,Bibimbap,Korean);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (4,Fry an egg, keeping the yolk runny.,Bibimbap,Korean);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (5,Assemble the dish by placing rice in a bowl, arranging the vegetables and beef on top, and placing the fried egg in the center.,Bibimbap,Korean);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (6,Serve with a dollop of gochujang on the side.,Bibimbap,Korean);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (1,Prepare the dough with flour, sugar, milk, and yeast. Let it rise until doubled in size.,Hoddeok,Korean);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (2,Mix brown sugar, chopped nuts, and cinnamon for the filling.,Hoddeok,Korean);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (3,Divide the dough into balls, flatten them, and place a spoonful of filling in the center.,Hoddeok,Korean);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (4,Seal the dough around the filling and flatten into a pancake shape.,Hoddeok,Korean);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (5,Fry each pancake in a lightly oiled pan until golden brown on both sides.,Hoddeok,Korean);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (6,Serve hot, allowing the syrupy filling to ooze out when bitten.,Hoddeok,Korean);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (1,In a pot, sauté pork belly until browned, then add chopped kimchi and cook until soft.,Kimchi Jjigae,Korean);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (2,Add water or stock and bring to a boil.,Kimchi Jjigae,Korean);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (3,Season with gochujang, gochugaru (Korean chili powder), and soy sauce.,Kimchi Jjigae,Korean);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (4,Add sliced tofu and simmer until all ingredients are well-cooked.,Kimchi Jjigae,Korean);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (5,Garnish with sliced green onions and serve hot with a bowl of rice.,Kimchi Jjigae,Korean);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (1,Roast poblano peppers, peel off the skin, and remove seeds.,Chiles en Nogada,Mexican);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (2,Prepare the picadillo by cooking ground meat with tomatoes, apples, pears, and peaches.,Chiles en Nogada,Mexican);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (3,Stuff the roasted chiles with the picadillo.,Chiles en Nogada,Mexican);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (4,Prepare a sauce by blending walnuts with milk, sugar, and sherry until smooth.,Chiles en Nogada,Mexican);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (5,Cover the stuffed chiles with the walnut cream sauce.,Chiles en Nogada,Mexican);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (6,Garnish with pomegranate seeds and parsley before serving.,Chiles en Nogada,Mexican);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (1,Preheat the oven to 350°F (175°C).,Flan,Mexican);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (2,Melt sugar in a pan until golden and pour into a round baking dish, swirling to coat the bottom.,Flan,Mexican);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (3,Blend eggs, condensed milk, evaporated milk, and vanilla extract until smooth.,Flan,Mexican);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (4,Pour the custard mixture over the caramelized sugar.,Flan,Mexican);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (5,Place the dish in a larger baking pan and fill the pan with hot water halfway up the sides of the dish.,Flan,Mexican);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (6,Bake in a water bath until set, about 45 minutes.,Flan,Mexican);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (7,Cool and refrigerate before serving. Invert onto a plate to serve.,Flan,Mexican);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (1,Marinate thinly sliced pork in a blend of chilies, achiote paste, garlic, and pineapple juice overnight.,Tacos al Pastor,Mexican);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (2,Cook the pork on a vertical spit or in a very hot skillet until charred and tender.,Tacos al Pastor,Mexican);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (3,Chop the cooked pork into small pieces.,Tacos al Pastor,Mexican);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (4,Warm small corn tortillas and fill with pork.,Tacos al Pastor,Mexican);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (5,Top with diced pineapple, chopped onions, and fresh cilantro.,Tacos al Pastor,Mexican);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (6,Serve with a squeeze of lime and salsa.,Tacos al Pastor,Mexican);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (1,Preheat the oven and grease the baking dish.,Baklava,Turkish);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (2,Layer the filo dough in the dish, brushing each sheet with melted butter and sprinkling chopped nuts between some of the layers.,Baklava,Turkish);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (3,Cut the layered pastry into diamond or square shapes before baking.,Baklava,Turkish);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (4,Bake until golden and crisp.,Baklava,Turkish);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (5,Immediately after baking, pour the prepared syrup evenly over the hot baklava.,Baklava,Turkish);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (6,Let cool to absorb the syrup before serving.,Baklava,Turkish);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (1,Grill seasoned lamb strips until well cooked.,İskender Kebab,Turkish);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (2,Toast pita bread lightly and cut into small pieces.,İskender Kebab,Turkish);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (3,Place the bread in a dish and cover with grilled lamb.,İskender Kebab,Turkish);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (4,Heat tomato sauce and pour over the meat.,İskender Kebab,Turkish);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (5,Melt butter and drizzle over the dish.,İskender Kebab,Turkish);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (6,Serve with a side of fresh yogurt.,İskender Kebab,Turkish);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (1,Prepare the dough from flour, water, yeast, and salt. Let it rise for an hour.,Lahmacun,Turkish);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (2,Mix minced meat with finely chopped bell peppers, tomatoes, onions, parsley, and spices.,Lahmacun,Turkish);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (3,Roll out the dough into thin circles and spread the meat mixture thinly on top.,Lahmacun,Turkish);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (4,Bake in a very hot oven until the edges are crisp and browned, about 5 minutes.,Lahmacun,Turkish);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (5,Serve hot, rolled up with a squeeze of lemon and optional garnishes like lettuce and sliced tomatoes.,Lahmacun,Turkish);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (1,Prepare the dough by mixing flour, water, salt, and a bit of oil into a smooth, elastic dough. Let it rest.,Gutap,Turkmen);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (2,For the filling, combine finely chopped spinach, green onions, dill, parsley, and optional cheese.,Gutap,Turkmen);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (3,Divide the dough into small balls, roll each out thinly, place a spoonful of filling in the center, then fold and seal the edges.,Gutap,Turkmen);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (4,Fry each pie in hot oil until golden brown on both sides.,Gutap,Turkmen);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (5,Drain on paper towels and serve warm.,Gutap,Turkmen);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (1,Heat oil in a large pot and brown the lamb pieces until golden.,Palaw,Turkmen);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (2,Add chopped onions and grated carrots to the pot and sauté until softened.,Palaw,Turkmen);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (3,Stir in rice, Turkmen saffron, and enough boiling water to cover the ingredients.,Palaw,Turkmen);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (4,Cook on low heat until the rice is fluffy and all the liquid is absorbed.,Palaw,Turkmen);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (5,Serve hot, garnished with fresh herbs.,Palaw,Turkmen);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (1,In a large pot, brown the lamb pieces to develop flavor.,Shurpa,Turkmen);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (2,Add water and bring to a boil, skimming off any foam that forms on the surface.,Shurpa,Turkmen);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (3,Add chopped potatoes, carrots, onions, and bell peppers to the pot.,Shurpa,Turkmen);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (4,Season with salt, pepper, and a bouquet garni of local herbs.,Shurpa,Turkmen);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (5,Simmer gently until the meat is tender and vegetables are cooked.,Shurpa,Turkmen);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (6,Serve hot, sprinkled with chopped herbs like dill and parsley.,Shurpa,Turkmen);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (1,Soak dried fruits in hot tea the night before baking to plump them up.,Bara Brith,Welsh);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (2,Mix flour, sugar, and spices in a bowl.,Bara Brith,Welsh);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (3,Add the soaked fruits with any remaining tea, followed by an egg, and mix to form a dough.,Bara Brith,Welsh);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (4,Pour the batter into a greased loaf pan.,Bara Brith,Welsh);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (5,Bake in a preheated oven at 350°F (175°C) for about 1.5 hours until risen and golden.,Bara Brith,Welsh);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (6,Cool in the pan, then turn out onto a wire rack.,Bara Brith,Welsh);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (7,Slice and serve with butter.,Bara Brith,Welsh);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (1,In a large pot, brown the lamb pieces, then remove and set aside.,Cawl,Welsh);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (2,In the same pot, sauté onions, carrots, and leeks until slightly softened.,Cawl,Welsh);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (3,Return the lamb to the pot, add potatoes, and cover with water or stock.,Cawl,Welsh);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (4,Bring to a boil, then reduce to a simmer, covering and cooking for at least 3 hours until the meat is tender and the vegetables are cooked.,Cawl,Welsh);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (5,Season with salt and pepper to taste, and add chopped parsley before serving.,Cawl,Welsh);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (6,Serve hot, with a side of crusty bread.,Cawl,Welsh);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (1,In a saucepan, melt butter and stir in the flour to make a roux.,Welsh Rarebit,Welsh);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (2,Gradually add beer to the roux while continuously stirring to create a smooth sauce.,Welsh Rarebit,Welsh);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (3,Add grated cheese to the saucepan, stirring until the cheese is melted.,Welsh Rarebit,Welsh);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (4,Season the cheese sauce with mustard, Worcestershire sauce, and a pinch of salt and pepper.,Welsh Rarebit,Welsh);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (5,Pour the hot cheese sauce over slices of toasted bread.,Welsh Rarebit,Welsh);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (6,Grill the topped bread under a broiler until bubbly and golden brown.,Welsh Rarebit,Welsh);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (7,Serve immediately.,Welsh Rarebit,Welsh);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (1,Brown lamb pieces in a skillet with a little oil.,Tavë Kosi,Albanian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (2,Place lamb in a baking dish and cover with rice and water.,Tavë Kosi,Albanian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (3,Bake in the oven at 375°F for 30 minutes.,Tavë Kosi,Albanian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (4,Whisk together yogurt, eggs, and flour; pour over the lamb and rice.,Tavë Kosi,Albanian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (5,Return to oven and bake until the topping is golden and set.,Tavë Kosi,Albanian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (6,Serve hot.,Tavë Kosi,Albanian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (1,Prepare phyllo dough and layer half in a greased baking dish.,Bakllasarem,Albanian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (2,Mix chopped walnuts, sugar, and cinnamon; spread over the phyllo.,Bakllasarem,Albanian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (3,Top with the remaining phyllo, brushing each layer with melted butter.,Bakllasarem,Albanian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (4,Cut into diamonds and bake at 350°F until golden and crisp.,Bakllasarem,Albanian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (5,Pour syrup made from sugar, water, and lemon juice over the hot pastry.,Bakllasarem,Albanian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (6,Allow to cool before serving.,Bakllasarem,Albanian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (1,Sauté chopped onions and bell peppers in olive oil until soft.,Fërgesë,Albanian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (2,Add chopped tomatoes and simmer until the mixture thickens.,Fërgesë,Albanian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (3,Stir in crumbled cottage cheese and season with salt and pepper.,Fërgesë,Albanian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (4,Cook until everything is heated through.,Fërgesë,Albanian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (5,Serve warm with crusty bread.,Fërgesë,Albanian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (1,Prepare rice according to package instructions.,Speca të mbushur,Albanian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (2,Mix cooked rice with chopped herbs, garlic, and precooked shrimp.,Speca të mbushur,Albanian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (3,Cut tops off bell peppers and remove seeds.,Speca të mbushur,Albanian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (4,Stuff peppers with rice mixture, place in a baking dish.,Speca të mbushur,Albanian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (5,Bake at 375°F until peppers are soft and filling is hot.,Speca të mbushur,Albanian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (6,Serve with lemon wedges.,Speca të mbushur,Albanian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (1,Preheat oven to 350°F.,Byrek me Spinaq,Albanian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (2,Sauté spinach until wilted, then mix with crumbled feta cheese and eggs.,Byrek me Spinaq,Albanian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (3,Layer phyllo sheets in a greased baking pan, brushing each with oil.,Byrek me Spinaq,Albanian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (4,Spread spinach mixture over phyllo, then cover with more phyllo sheets.,Byrek me Spinaq,Albanian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (5,Bake until golden brown.,Byrek me Spinaq,Albanian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (6,Cut into squares and serve.,Byrek me Spinaq,Albanian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (1,Soak beans overnight, then drain and rinse.,Jani me fasule,Albanian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (2,Sauté onions and garlic in a pot until translucent.,Jani me fasule,Albanian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (3,Add beans, water, and chopped tomatoes. Bring to a boil, then reduce to a simmer.,Jani me fasule,Albanian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (4,Cook covered on low heat for 2 hours until beans are tender.,Jani me fasule,Albanian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (5,Season with salt, pepper, and a pinch of chili powder.,Jani me fasule,Albanian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (6,Serve hot with bread.,Jani me fasule,Albanian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (1,Preheat oven to 350°F.,Shëndetli,Albanian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (2,Prepare cake batter with eggs, sugar, and ground walnuts.,Shëndetli,Albanian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (3,Pour into a greased pan and bake until a toothpick comes out clean.,Shëndetli,Albanian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (4,Simultaneously, prepare syrup with sugar, water, and lemon juice.,Shëndetli,Albanian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (5,Pour hot syrup over the hot cake after removing from oven.,Shëndetli,Albanian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (6,Let absorb and cool before serving.,Shëndetli,Albanian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (1,Cook rice until tender, then mix with beaten eggs, chopped mint, and salt.,Qifqi,Albanian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (2,Heat oil in a deep skillet.,Qifqi,Albanian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (3,Form rice mixture into small balls and fry until golden and crispy.,Qifqi,Albanian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (4,Drain on paper towels and serve hot.,Qifqi,Albanian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (1,Slice zucchini, bell peppers, eggplants, and tomatoes into even pieces.,Përime në zgare,Albanian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (2,Marinate with olive oil, garlic, and herbs.,Përime në zgare,Albanian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (3,Grill on high heat until vegetables are tender and have grill marks.,Përime në zgare,Albanian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (4,Serve hot or at room temperature, garnished with fresh basil.,Përime në zgare,Albanian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (1,Clean mussels and discard any that are open and do not close when tapped.,Mish me midhje,Albanian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (2,Heat olive oil in a large skillet, add minced garlic, and sauté until fragrant.,Mish me midhje,Albanian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (3,Add mussels and cover with white wine, simmer until mussels open.,Mish me midhje,Albanian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (4,Sprinkle with chopped parsley and serve hot.,Mish me midhje,Albanian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (5,Serve with pasta or fresh bread.,Mish me midhje,Albanian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (1,Form ground beef into patties and season with salt and pepper.,Cheeseburger,American);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (2,Grill patties on medium-high heat until desired doneness.,Cheeseburger,American);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (3,Place a slice of cheese on each patty in the last minute of cooking to melt.,Cheeseburger,American);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (4,Toast hamburger buns on the grill.,Cheeseburger,American);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (5,Assemble the burgers by placing lettuce, tomato, patty with cheese, onions, and pickles on the bun.,Cheeseburger,American);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (6,Serve with ketchup, mustard, or mayonnaise.,Cheeseburger,American);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (1,Prepare the pie crust and line a pie dish with one layer of crust.,Apple Pie,American);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (2,Mix sliced apples with sugar, cinnamon, and flour.,Apple Pie,American);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (3,Fill the pie crust with the apple mixture.,Apple Pie,American);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (4,Cover with the second layer of crust, seal edges, and cut small slits in the top.,Apple Pie,American);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (5,Bake at 375°F until the crust is golden and the filling is bubbly.,Apple Pie,American);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (6,Serve warm with vanilla ice cream.,Apple Pie,American);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (1,Combine flour, salt, pepper, paprika, and garlic powder in a bowl.,Fried Chicken,American);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (2,Dip chicken pieces in beaten eggs, then dredge in flour mixture.,Fried Chicken,American);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (3,Heat oil in a deep fryer or large skillet to 350°F.,Fried Chicken,American);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (4,Fry chicken until crispy and cooked through, about 10 minutes per side.,Fried Chicken,American);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (5,Drain on paper towels and serve.,Fried Chicken,American);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (1,Cook macaroni according to package instructions; drain.,Macaroni and Cheese,American);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (2,In a saucepan, melt butter and stir in flour to make a roux.,Macaroni and Cheese,American);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (3,Gradually add milk to the roux, stirring constantly until thickened.,Macaroni and Cheese,American);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (4,Remove from heat and mix in grated cheese until melted.,Macaroni and Cheese,American);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (5,Combine cheese sauce with macaroni, transfer to a baking dish, and bake at 375°F for 20 minutes.,Macaroni and Cheese,American);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (6,Optionally, top with breadcrumbs and bake until golden.,Macaroni and Cheese,American);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (1,Rub ribs with a mixture of paprika, garlic powder, salt, and sugar.,Barbecue Ribs,American);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (2,Wrap ribs in foil and bake at 275°F for 3 hours until tender.,Barbecue Ribs,American);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (3,Remove ribs from foil, brush with barbecue sauce, and grill for 10 minutes on each side.,Barbecue Ribs,American);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (4,Serve with extra barbecue sauce.,Barbecue Ribs,American);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (1,Mix flour, sugar, baking powder, and salt in a bowl.,Pancakes,American);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (2,In another bowl, whisk together milk, egg, and melted butter.,Pancakes,American);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (3,Combine the wet and dry ingredients until just mixed; some lumps are okay.,Pancakes,American);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (4,Heat a griddle or skillet over medium heat and pour batter to form pancakes.,Pancakes,American);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (5,Cook until bubbles form on the surface, then flip and cook until golden.,Pancakes,American);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (6,Serve with butter and maple syrup.,Pancakes,American);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (1,Cream together butter and sugars until fluffy.,Chocolate Chip Cookies,American);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (2,Beat in eggs and vanilla extract.,Chocolate Chip Cookies,American);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (3,Mix in flour, baking soda, and salt.,Chocolate Chip Cookies,American);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (4,Stir in chocolate chips.,Chocolate Chip Cookies,American);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (5,Drop spoonfuls of dough onto a baking sheet and bake at 350°F for 10 minutes or until golden.,Chocolate Chip Cookies,American);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (6,Cool on a wire rack before serving.,Chocolate Chip Cookies,American);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (1,Cook bacon until crispy.,BLT Sandwich,American);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (2,Toast slices of bread.,BLT Sandwich,American);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (3,Spread mayonnaise on one side of each slice of bread.,BLT Sandwich,American);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (4,Layer crispy bacon, sliced tomatoes, and lettuce leaves on one slice, then top with another slice of bread.,BLT Sandwich,American);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (5,Cut in half and serve.,BLT Sandwich,American);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (1,Cook chopped bacon until crisp; set aside.,Clam Chowder,American);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (2,In the same pot, sauté onions and celery until soft.,Clam Chowder,American);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (3,Add potatoes, clams with juice, water, and seasonings; simmer until potatoes are tender.,Clam Chowder,American);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (4,Stir in cream and heat through without boiling.,Clam Chowder,American);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (5,Serve garnished with crispy bacon and oyster crackers.,Clam Chowder,American);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (1,Melt butter and chocolate together.,Brownies,American);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (2,Stir in sugar, eggs, and vanilla extract.,Brownies,American);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (3,Mix in flour, cocoa powder, and salt.,Brownies,American);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (4,Fold in additional chocolate chunks.,Brownies,American);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (5,Pour batter into a greased baking pan and bake at 350°F for 25 minutes.,Brownies,American);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (6,Cool in pan before cutting into squares and serving.,Brownies,American);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (1,Chop tomatoes, cucumbers, and onions into bite-sized pieces.,Shopska Salata,Bulgarian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (2,Combine in a bowl and season with salt and olive oil.,Shopska Salata,Bulgarian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (3,Top with grated sirene cheese and a sprinkle of parsley before serving.,Shopska Salata,Bulgarian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (1,Brown the meat in a pot with some oil.,Kavarma,Bulgarian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (2,Add chopped onions, peppers, and mushrooms to the pot and sauté until soft.,Kavarma,Bulgarian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (3,Stir in paprika, a splash of white wine, and tomato paste. Cover and simmer for an hour.,Kavarma,Bulgarian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (4,Season with salt, pepper, and fresh herbs before serving.,Kavarma,Bulgarian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (1,Mix beaten eggs with crumbled sirene cheese and yogurt.,Banitsa,Bulgarian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (2,Layer sheets of phyllo dough in a greased baking dish, brushing each with melted butter.,Banitsa,Bulgarian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (3,Spread the egg and cheese mixture between layers of phyllo.,Banitsa,Bulgarian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (4,Bake at 375°F until golden brown and puffed.,Banitsa,Bulgarian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (5,Cut into squares and serve hot.,Banitsa,Bulgarian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (1,Mix flour, yeast, and yogurt to form a soft dough. Let it rise until doubled.,Mekitsa,Bulgarian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (2,Heat oil in a deep fryer.,Mekitsa,Bulgarian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (3,Roll out small pieces of dough and fry until golden brown on both sides.,Mekitsa,Bulgarian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (4,Drain on paper towels and sprinkle with powdered sugar, or serve with honey or jam.,Mekitsa,Bulgarian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (1,Layer thinly sliced potatoes and seasoned minced meat in a baking dish.,Musaka,Bulgarian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (2,Mix eggs with yogurt and pour over the layers.,Musaka,Bulgarian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (3,Bake at 350°F until the top is golden and the potatoes are tender.,Musaka,Bulgarian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (4,Allow to set before serving.,Musaka,Bulgarian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (1,Combine yogurt with water to a soup-like consistency.,Tarator,Bulgarian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (2,Add finely chopped cucumbers, crushed garlic, chopped dill, and crushed walnuts.,Tarator,Bulgarian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (3,Season with salt and olive oil.,Tarator,Bulgarian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (4,Chill in the fridge for at least an hour before serving.,Tarator,Bulgarian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (1,Layer kadaif dough in a tray, interspersing with mixed nuts.,Kadaif,Bulgarian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (2,Bake until golden brown.,Kadaif,Bulgarian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (3,Pour a hot syrup made of sugar, water, and lemon juice over the baked kadaif.,Kadaif,Bulgarian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (4,Let it cool and absorb the syrup before serving.,Kadaif,Bulgarian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (1,Toast bread slices lightly.,Bulgarian Cheese Toast,Bulgarian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (2,Spread a thick layer of grated Bulgarian cheese on each slice.,Bulgarian Cheese Toast,Bulgarian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (3,Broil in the oven until the cheese is bubbly and golden.,Bulgarian Cheese Toast,Bulgarian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (4,Optionally top with a fried egg and serve immediately.,Bulgarian Cheese Toast,Bulgarian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (1,Prepare walnut sponge layers by beating egg whites with sugar and folding in ground walnuts and flour.,Garash Cake,Bulgarian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (2,Bake each layer separately until set.,Garash Cake,Bulgarian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (3,Prepare chocolate ganache with heavy cream and dark chocolate.,Garash Cake,Bulgarian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (4,Assemble the cake by layering sponge and ganache, finishing with a ganache topping.,Garash Cake,Bulgarian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (5,Chill in the fridge to set before serving.,Garash Cake,Bulgarian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (1,Prepare cabbage leaves by boiling until tender.,Sarmi,Bulgarian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (2,Mix minced meat with rice, onions, and spices.,Sarmi,Bulgarian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (3,Place a spoonful of the filling on each leaf and roll tightly.,Sarmi,Bulgarian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (4,Arrange the rolls in a pot, cover with tomato sauce and water.,Sarmi,Bulgarian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (5,Simmer on low heat until the meat and rice are fully cooked.,Sarmi,Bulgarian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (6,Serve hot, garnished with fresh herbs.,Sarmi,Bulgarian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (1,Slice beef into thin strips.,Beef Stroganoff,Russian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (2,Season beef with salt and pepper.,Beef Stroganoff,Russian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (3,Heat oil in a pan over medium heat and sauté onions until translucent.,Beef Stroganoff,Russian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (4,Add beef to the pan and brown.,Beef Stroganoff,Russian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (5,Reduce heat and add mustard and beef broth. Simmer for 10 minutes.,Beef Stroganoff,Russian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (6,Stir in sour cream and cook for another 5 minutes without boiling.,Beef Stroganoff,Russian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (7,Serve hot over noodles or rice.,Beef Stroganoff,Russian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (1,Mix honey, sugar, and eggs in a bowl.,Medovik,Russian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (2,Add baking soda and melt mixture over steam until it increases in volume.,Medovik,Russian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (3,Mix flour into the warm honey mixture to form dough.,Medovik,Russian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (4,Divide the dough into 8 parts, roll out each and bake for 5 minutes at 350°F.,Medovik,Russian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (5,Whisk sour cream with sugar and vanilla.,Medovik,Russian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (6,Spread cream between each cooled cake layer.,Medovik,Russian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (7,Coat the outside with leftover cream and crumble a baked dough layer on top.,Medovik,Russian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (8,Chill in fridge overnight before serving.,Medovik,Russian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (1,Peel and chop all vegetables.,Borscht,Russian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (2,Sauté onions and carrots in a pot.,Borscht,Russian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (3,Add beets and continue to sauté for a few minutes.,Borscht,Russian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (4,Add water, cabbage, and potatoes and bring to a boil.,Borscht,Russian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (5,Simmer until all vegetables are tender.,Borscht,Russian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (6,Add vinegar, sugar, and salt to taste.,Borscht,Russian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (7,Serve with sour cream and fresh dill.,Borscht,Russian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (1,Mix flour, eggs, water, and salt to form a dough.,Pelmeni,Russian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (2,Roll dough thin and cut into circles.,Pelmeni,Russian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (3,Place a small amount of meat filling in the center of each circle.,Pelmeni,Russian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (4,Fold dough over and seal edges to form a dumpling.,Pelmeni,Russian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (5,Boil dumplings in salted water until they float to the surface.,Pelmeni,Russian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (6,Serve hot with melted butter or sour cream.,Pelmeni,Russian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (1,Mix tvorog, eggs, flour, sugar, and vanilla.,Syrniki,Russian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (2,Form small patties from the mixture.,Syrniki,Russian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (3,Fry patties in a hot, oiled pan until golden brown on both sides.,Syrniki,Russian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (4,Serve hot with sour cream or jam.,Syrniki,Russian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (1,Rinse buckwheat groats under cold water.,Kasha,Russian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (2,Bring water to a boil and add groats.,Kasha,Russian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (3,Reduce heat to low, cover, and simmer until groats are tender and water is absorbed.,Kasha,Russian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (4,Serve hot with milk or as a side dish to meat.,Kasha,Russian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (1,Mix honey, sugar, and spices in a bowl.,Pryaniki,Russian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (2,Add eggs and melted butter, then blend in flour to form a stiff dough.,Pryaniki,Russian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (3,Roll out dough and cut into shapes.,Pryaniki,Russian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (4,Bake at 350°F for 15-20 minutes.,Pryaniki,Russian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (5,Mix powdered sugar with lemon juice to make icing.,Pryaniki,Russian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (6,Glaze cookies after they have cooled.,Pryaniki,Russian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (1,Puree apples and mix with sugar.,Zefir,Russian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (2,Heat mixture until sugar dissolves.,Zefir,Russian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (3,Whip egg whites to stiff peaks.,Zefir,Russian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (4,Gradually combine hot fruit mixture with egg whites.,Zefir,Russian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (5,Pipe onto parchment paper into desired shapes.,Zefir,Russian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (6,Let dry at room temperature for 12 hours.,Zefir,Russian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (1,Boil potatoes, carrots, and eggs until cooked.,Olivier Salad,Russian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (2,Dice all cooked ingredients and pickles.,Olivier Salad,Russian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (3,Combine in a bowl with peas and diced chicken.,Olivier Salad,Russian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (4,Mix thoroughly with mayonnaise.,Olivier Salad,Russian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (5,Chill before serving.,Olivier Salad,Russian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (1,Sauté onions and carrots in a pot.,Shchi,Russian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (2,Add meat (beef or pork) and sauté until browned.,Shchi,Russian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (3,Add water and bring to a boil.,Shchi,Russian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (4,Add chopped cabbage and potatoes, simmer until all ingredients are tender.,Shchi,Russian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (5,Season with salt, pepper, and herbs before serving.,Shchi,Russian);
INSERT INTO step (number,description,recipe_name,recipe_cuisine_name) VALUES (6,Serve with a dollop of sour cream.,Shchi,Russian);
